import React from 'react';
import './Sistemcek.css';

const Sistemcek = () => {
  return (
    <div className="sistemcek-container">
      <header className="sistemcek-header">
        <h1>Sistemček</h1>
      </header>

      <main className="sistemcek-main">
        <div className="sistemcek-card">
          <h2>Vnesite celotno besedilo ali ključne besede</h2>
          <textarea
            placeholder="Besedilo..."
            className="sistemcek-textarea"
          />
          <button className="sistemcek-button">Potrdi</button>
        </div>
      </main>
    </div>
  );
};

export default Sistemcek;
